from collections import Counter

class CONV():
    def __init__(self,multiset_a,multiset_b):
        self.mink_diff = []
        for s_a in multiset_a:
            for s_b in multiset_b:
                self.mink_diff.append(round(s_a - s_b,4))

    def get_largest_multiplicity_of_multiset_and_value(self):
        return Counter(self.mink_diff).most_common(1)[0]


